import { APP_ID, REDIRECT_URI } from './environment'

export const authConfig = {
  appId: APP_ID,
  redirectUri: REDIRECT_URI,
  scopes: [
    'user.read',
    'mailboxsettings.read',
    'calendars.readwrite'
  ]
};
